const fontname = {
  face: function () {
    return `
      @font-face {
        font-family: 'klsweetpineapplethinthin';
        src: url(data:application/font-woff;charset=utf-8;base64,) format('woff');
        font-weight: normal;
        font-style: normal;
      }

      svg {
        width: 100%;
        height: auto;
        max-height: 150px;
      }

      .svg-gb-7 {
        font-family: 'klsweetpineapplethinthin';
      }
    `
  }
}

export { fontname };
